import React from 'react';
import { motion } from 'framer-motion';
import { ExternalLink, ArrowRight } from 'lucide-react';

interface Project {
  id: number;
  title: string;
  description: string;
  category: string;
  image: string;
  technologies: string[];
  link: string;
  featured: boolean;
}

const Projects: React.FC = () => {
  const projects: Project[] = [
    {
      id: 1,
      title: "FinTech Mobile App",
      description: "Redesigned the mobile banking experience for a leading fintech company, improving user engagement by 40% and reducing support tickets by 60%.",
      category: "Mobile Design",
      image: "https://images.unsplash.com/photo-1554224155-6726b3ff858f?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
      technologies: ["Figma", "Prototyping", "User Research", "iOS/Android"],
      link: "#",
      featured: true
    },
    {
      id: 2,
      title: "E-commerce Platform",
      description: "Created a seamless shopping experience that increased conversion rates by 35% and improved mobile usability scores.",
      category: "Web Design",
      image: "https://images.unsplash.com/photo-1556742049-0cfed4f6a45d?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
      technologies: ["Sketch", "InVision", "A/B Testing", "Analytics"],
      link: "#",
      featured: true
    },
    {
      id: 3,
      title: "Healthcare Dashboard",
      description: "Designed an intuitive dashboard for healthcare professionals to manage patient data and improve workflow efficiency.",
      category: "Dashboard Design",
      image: "https://images.unsplash.com/photo-1576091160399-112ba8d25d1f?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
      technologies: ["Figma", "Design Systems", "Accessibility", "Healthcare UX"],
      link: "#",
      featured: false
    },
    {
      id: 4,
      title: "Travel Booking App",
      description: "Streamlined the booking process for a travel platform, reducing booking time by 50% and improving user satisfaction.",
      category: "Mobile Design",
      image: "https://images.unsplash.com/photo-1488646953014-85cb44e25828?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
      technologies: ["Adobe XD", "User Testing", "Information Architecture", "Mobile UX"],
      link: "#",
      featured: false
    },
    {
      id: 5,
      title: "SaaS Product Redesign",
      description: "Complete redesign of a B2B SaaS platform, resulting in 25% increase in user retention and improved feature adoption.",
      category: "Web Design",
      image: "https://images.unsplash.com/photo-1460925895917-afdab827c52f?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
      technologies: ["Figma", "Design Systems", "User Research", "B2B UX"],
      link: "#",
      featured: false
    },
    {
      id: 6,
      title: "Educational Platform",
      description: "Designed an engaging learning platform that increased student engagement and improved learning outcomes.",
      category: "Web Design",
      image: "https://images.unsplash.com/photo-1522202176988-66273c2fd55f?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80",
      technologies: ["Sketch", "Gamification", "Learning UX", "Accessibility"],
      link: "#",
      featured: false
    }
  ];

  const featuredProjects = projects.filter(project => project.featured);
  const otherProjects = projects.filter(project => !project.featured);

  return (
    <section id="projects" className="section bg-background-primary">
      <div className="container">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-3xl md:text-4xl font-bold text-text-primary mb-4">
            Featured Projects
          </h2>
          <p className="text-text-secondary text-lg max-w-2xl mx-auto">
            A selection of my recent work showcasing user-centered design solutions
          </p>
        </motion.div>

        {/* Featured Projects */}
        <div className="grid lg:grid-cols-2 gap-8 mb-16">
          {featuredProjects.map((project, index) => (
            <motion.div
              key={project.id}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: index * 0.1 }}
              viewport={{ once: true }}
              className="group cursor-pointer"
            >
              <div className="bg-white rounded-2xl overflow-hidden shadow-lg hover:shadow-xl transition-all duration-300 transform hover:-translate-y-2">
                <div className="relative overflow-hidden">
                  <img
                    src={project.image}
                    alt={project.title}
                    className="w-full h-64 object-cover group-hover:scale-105 transition-transform duration-300"
                  />
                  <div className="absolute inset-0 bg-gradient-to-t from-black/60 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300" />
                  <div className="absolute bottom-4 left-4 right-4 text-white opacity-0 group-hover:opacity-100 transition-opacity duration-300">
                    <ExternalLink size={20} />
                  </div>
                </div>

                <div className="p-6">
                  <div className="flex items-center justify-between mb-3">
                    <span className="text-sm font-medium text-primary-color bg-primary-color/10 px-3 py-1 rounded-full">
                      {project.category}
                    </span>
                  </div>

                  <h3 className="text-xl font-semibold text-text-primary mb-3 group-hover:text-primary-color transition-colors duration-200">
                    {project.title}
                  </h3>

                  <p className="text-text-secondary mb-4 leading-relaxed">
                    {project.description}
                  </p>

                  <div className="flex flex-wrap gap-2 mb-4">
                    {project.technologies.map((tech, techIndex) => (
                      <span
                        key={techIndex}
                        className="text-xs text-text-light bg-background-accent px-2 py-1 rounded"
                      >
                        {tech}
                      </span>
                    ))}
                  </div>

                  <div className="flex items-center text-primary-color font-medium group-hover:translate-x-1 transition-transform duration-200">
                    <span className="mr-2">View Case Study</span>
                    <ArrowRight size={16} />
                  </div>
                </div>
              </div>
            </motion.div>
          ))}
        </div>

        {/* Other Projects Grid */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="mb-8"
        >
          <h3 className="text-2xl font-semibold text-text-primary mb-8 text-center">
            More Work
          </h3>
        </motion.div>

        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
          {otherProjects.map((project, index) => (
            <motion.div
              key={project.id}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              className="group cursor-pointer"
            >
              <div className="bg-white rounded-xl overflow-hidden shadow-md hover:shadow-lg transition-all duration-300 transform hover:-translate-y-1">
                <div className="relative overflow-hidden">
                  <img
                    src={project.image}
                    alt={project.title}
                    className="w-full h-48 object-cover group-hover:scale-105 transition-transform duration-300"
                  />
                  <div className="absolute inset-0 bg-gradient-to-t from-black/60 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300" />
                </div>

                <div className="p-5">
                  <span className="text-sm font-medium text-primary-color bg-primary-color/10 px-2 py-1 rounded-full">
                    {project.category}
                  </span>

                  <h4 className="text-lg font-semibold text-text-primary mt-3 mb-2 group-hover:text-primary-color transition-colors duration-200">
                    {project.title}
                  </h4>

                  <p className="text-text-secondary text-sm mb-3 leading-relaxed">
                    {project.description}
                  </p>

                  <div className="flex items-center text-primary-color text-sm font-medium group-hover:translate-x-1 transition-transform duration-200">
                    <span className="mr-1">View Project</span>
                    <ArrowRight size={14} />
